    let Message = () => {
        let url = "/dialogs/" + props.id
        return(
            <Route path={url} render={() =><div>{props.text}</div> }/>
        )
    }
    let messages = props.messages.map(m =><Message text={m.text}/>
    )
    debugger
    return (
        <div className={style.message}>
            {messages}
        </div>
    )
}

export default Message
